import React from 'react';
import { BrowserRouter as Router, Route, Routes, Navigate } from 'react-router-dom';
import { Authenticator, ThemeProvider } from '@aws-amplify/ui-react';
import '@aws-amplify/ui-react/styles.css';
import Home from './Home'; // Create a Home component for the main page
import Learn from './Learn'; // Create a Learn component for the /learn page

const myTheme = {
  name: 'my-theme',
  tokens: {
    colors: {
      brand: {
        primary: {
          10: '#f0f0f0',
          80: '#1f2937',
          100: '#111827', // Customize the primary brand color
        },
      },
    },
    components: {
      button: {
        primary: {
          backgroundColor: { value: '{colors.brand.primary.100}' },
          color: { value: '#ffffff' },
        },
      },
    },
  },
};

function App() {

  return (
    <ThemeProvider theme={myTheme}>
      <Authenticator>
        {({ signOut, user }) => (
          <div className="App">
            <h1>Welcome, {user.username}</h1>
            <button onClick={signOut}>Sign Out</button>
          </div>
        )}
      </Authenticator>
    </ThemeProvider>
  );
}

export default withAuthenticator(App);
